import Opcao from "./opcao";

function Topo() {
  return (
    <div className="topo">
      <div>
        <Opcao
          titulo="Escolha uma opção"
          opcoes={["Padrão", "cURL", "PHP", "Node", "Python", "Postman"]}
        ></Opcao>
      </div>
    </div>
  );
}

export default Topo;
